  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0104279 includes physical
  and underway data collected aboard the KNORR during cruise KN195-13 in the Caribbean
  Sea, North Atlantic Ocean and North Pacific Ocean from 2009-08-14 to 2009-09-10.
  These data include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
  COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
  These data were collected by Woods Hole Oceanographic Institution as part of Transit.
  The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC as part
  of the NSF sponsored Rolling Deck to Repository (R2R) program. The ADCP data represent
  the raw and automated processed data set. Post processed quality assessed data are
  not available in this accession.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
